A Windows Management Instrumentation event associated with a consumer that contains suspect content was identified. This may indicate that threat actors are persisting malware using WMI.

Example:
>shell = WScript.CreateObject("WScript.Shell"); shell.run("malware");

A script block event associated with the enumerating Active Directory objects via a PowerShell command, was identified. This activity may indicate that an adversary is attempting to discover information in order to shape follow-on behaviors.

Examples:
> get-aduser -filter {AdminCount -eq 1}
> get-aduser -filter {AdminCount -eq $True}

